import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import UserInfo from './urls/user_info/user_info.js';
import Login from './urls/login/login.js';
import NotFound from './urls/not_found/not_found.js';

import { BrowserRouter, Route, Routes } from "react-router-dom";

import { getWebInstrumentations, initializeFaro } from '@grafana/faro-web-sdk';
import { TracingInstrumentation } from '@grafana/faro-web-tracing';

var faro = initializeFaro({
    url: 'https://faro-collector-prod-us-east-0.grafana.net/collect/ff3e2065d1565ee33b4385bbefb6fde4',
    app: {
      name: 'Outstaff-web',
      version: '1.0.0',
      environment: 'production'
    },

    instrumentations: [
      // Mandatory, overwriting the instrumentations array would cause the default instrumentations to be omitted
      ...getWebInstrumentations(),

      // Initialization of the tracing package.
      // This packages is optional because it increases the bundle size noticeably. Only add it if you want tracing data.
      new TracingInstrumentation(),
    ],
  });

const root = ReactDOM.createRoot(document.getElementById('root'));

root.render(
    <BrowserRouter>
        <Routes>
            <Route path='/user/*' element={<UserInfo />} />
            <Route path='/login' element={<Login />} />
            <Route path='*' element={<NotFound name='404' text='Страница не найдена' />} />
        </Routes>
    </BrowserRouter>
);
